import React from 'react';
import { Link, useNavigate } from 'react-router-dom';  // Updated import to use useNavigate

function Home() {
  const navigate = useNavigate();  // useNavigate for navigation

  const handleLogout = () => {
    // You might want to clear user data or perform other cleanup tasks here
    navigate('/login'); // Redirect to login page after logout
  };

  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-success bg-success">
        <div className="container-fluid">
          <Link className="navbar-brand" to="/home">DLAB ADMIN PANEL</Link>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav">
              {/* <li className="nav-item">
                <Link className="nav-link active" aria-current="page" to="/home">Home</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/about">About</Link>
              </li> */}
              <li className="nav-item " style={{ float: 'ight'}}>
                <button className="btn btn-link nav-link" onClick={handleLogout}>Logout</button>
              </li>
            </ul>
          </div>
        </div>
      </nav>
      <div className="container mt-3">
        Hello
      </div>
    </div>
  );
}

export default Home;
